import React from "react"

import Chatbot from "./components/Chatbot"
import Chats from "./components/Chats"

function App() {
  return (
    <div className="App">
      <header className="App-header">
        App
      </header>
      <Chatbot />
      <Chats />
    </div>
  );
}

export default App;
